import {ImageConfig} from "../../constants";
import HowItWorksCardComponent from "../../shared/components/how-it-works-card/HowItWorksCardComponent";
import "./HowItWorksScreen.scss";
import {Col, Container, Row} from "react-grid-system";
import ButtonComponent from "../../shared/components/core/button/ButtonComponent";
import {Link} from "react-router-dom";
import {CommonService} from "../../shared/services";

export interface HowItWorksScreenProps {

}

const cardsDataList = [
    {
        icon: ImageConfig.SafeAndSecure,
        title: 'Safe & Secure',
        description: 'All of your data is secured and protected by SSL encryption'
    },
    {
        icon: ImageConfig.FastAssessment,
        title: 'Fast Assessment',
        description: 'Complete your assessment within 2-minutes process'
    },
    {
        icon: ImageConfig.AIResult,
        title: 'AI Processed Result',
        description: 'Our extensively effective AI gives you the best accuracy upto 95%'
    },
    {
        icon: ImageConfig.Compliance,
        title: 'Compliance',
        description: 'Verified and validated procedure under the HIPAA Compliance'
    },
]
const HowItWorksScreen = (props: HowItWorksScreenProps) => {

    return (
        <div className="screen how-it-works-screen">
            <div className="branding-logo">
                <img src={ImageConfig.sdiLogo} alt="sdilogo"/>
            </div>
            <div className="how-it-works-content-wrapper">
                <div className="how-it-works-title">How it works?</div>
                <div className="how-it-works-description">The symptoms assessment supported by CDC-approved questions
                    enables a rapid and accurate analysis of the COVID-19 symptoms, wherein the necessary action
                    measures based on the screening service results are recommended.
                </div>
            </div>
            <div className="cards-container">
                <Row>
                    <Col sm={12} lg={1}/>
                    {cardsDataList && cardsDataList?.length &&
                        cardsDataList.map((data) => {
                            return (
                                <Col sm={12} md={6} lg={2.5}>
                                    <Container>
                                        <HowItWorksCardComponent icon={data.icon}
                                                                 title={data.title}
                                                                 description={data.description}/>
                                    </Container>
                                </Col>
                            )
                        })
                    }
                    <Col sm={12} lg={1}/>
                </Row>
            </div>
            <div className="screening-test-button">
                <Link to={CommonService._routeConfig.RegisterRoute()}>
                    <ButtonComponent
                        fullWidth={false}
                        size={"lg"}
                        className={"zoomInZoomOut"}
                        type={"button"}>
                        Get My Screening Test Now
                    </ButtonComponent>
                </Link>
            </div>

            <div className="footer-content-wrapper">
                <div className="horizontal-line"/>
                <div className="copyright-content">
                    Copyright - SDI Labs INC | <a href="https://sdilabsinc.com/privacy-policy/" target="_blank"
                                                  rel="noreferrer"
                                                  className="navigate-link">Privacy Policy</a>
                </div>
            </div>
        </div>
    );

};

export default HowItWorksScreen;
